import React from "react";
import images from "../components/utilities/images";

const style = {
  display: "flex",
  flexFlow: "column nowrap",
  width: "90%"
};

const Homepage = () => {
  return (
    <div style={style}>
      <header>
        <h1>Edgar Cuarezma</h1>
      </header>
      <img src={`../images/home/${images.home}`} />
      <h2>Fine Art Illustration</h2>
    </div>
  );
};

export default Homepage;
